var scrollLocked = false;
var windowTop = $(window).scrollTop();

function lockScroll() {
    windowTop = $(window).scrollTop();
    scrollLocked = !scrollLocked;
  
    var bodyElement = $('body');
    var wwidth = $(window).width();
  
    bodyElement.addClass('fixed');
  
    bodyElement.css({
      "top": -windowTop,
      "padding-right": $(window).width() - wwidth
    });
  }
  
  function unlockScroll() {
    var bodyElement = $('body');
    scrollLocked = !scrollLocked;
  
    bodyElement.removeClass('fixed');
    bodyElement.css({
      'top': 0,
      'padding-right': 0
    });
  
    $(window).scrollTop(windowTop);
  }

function preloader() {
    var animateStart = function(timing, delay) {
        var item = this;
        setTimeout(function() {
            item.css('transition-duration', timing/2+'ms');
            item.addClass('animating');
            animateMidway.call(item, timing);
        }, delay);
    }

    var animateMidway = function(timing) {
        var item = this;
        setTimeout(function() {
            item.addClass('animation-midway');
            animateEnd.call(item, timing);
        }, timing/2);
    }

    var animateEnd = function(timing) {
        var item = this;
        setTimeout(function() {
            item.removeClass('animating');
            item.addClass('animation-end');
        }, timing/2)
    }    
    
    var animateItem = function(timing, delay) {
        animateStart.call(this, timing, delay);
    }

    function beforePreloaderStart() {
        var wwidth = window.outerWidth;
        
        $(window).scrollTop(0);
        $('body').css('padding-right', wwidth - $(window).width()).addClass('preloading');
    }
    
    function finishPreloader(delay) {
        setTimeout(function() {
            $('.preloader').hide();
            $('.header__content').removeClass('has-preloader');
            $('body').css('padding-right', 0).removeClass('preloading');
        }, delay);
    }
    
    function startPreloader() {        
        beforePreloaderStart();
        
        var line0 = $('.preloader__line--0')
            // line1 = $('.preloader__line--1'),
            // line2 = $('.preloader__line--2'),
            // line3 = $('.preloader__line--3'),
            line4 = $('.preloader__line--4'),
            line5 = $('.preloader__line--5'),
            line6 = $('.preloader__line--6');
    
        var square1 = $('.preloader__square--1'),
            square2 = $('.preloader__square--2'),
            square3 = $('.preloader__square--3'),
            square4 = $('.preloader__square--4'),
            square5 = $('.preloader__square--5'),
            square6 = $('.preloader__square--6'),
            square7 = $('.preloader__square--7');
    
        var diagonal1 = $('.svg-line_1'),
            diagonal2 = $('.svg-line_2');
        
        var logoTopCircle = $('.logo-path-top'),
            logoBotCircle = $('.logo-path-bot'),
            logoNK = $('.logo-path-abbreviation');
            
        var logoText = $('.logo-text');
            
        var burgerLine1 = $('.preloader__line--10'),
            burgerLine2 = $('.preloader__line--11');
        
        animateItem.call(line4, 500, 0); // start and step 1.0
        animateItem.call(line0, 600, 500); // steps from 1.1 throught 1.3 concated
        // animateItem.call(line1, 500, 250); // step 1.1
        // animateItem.call(line2, 500, 500); // step 1.2
        animateItem.call(line5, 500, 750); // step 1.3
        animateItem.call(line6, 500, 1000); // step 1.4, end step 1.0
    
        animateItem.call(square2, 500, 500); // step 1.3.1 delay equal 1.3 step's delay(x1.5)
        animateItem.call(square1, 500, 750); // for decoration
    
        // animateItem.call(line3, 500, 750); // step 1.3
    
        animateItem.call(square3, 500, 375); // for decoration
        animateItem.call(square4, 500, 500); // for decoration
        animateItem.call(square5, 500, 575); // for decoration
        animateItem.call(square6, 500, 750); // for decoration
        animateItem.call(square7, 500, 375); // for decoration
    
        animateItem.call(diagonal1, 800, 1000); // start step 2.0 after step 1.4
        animateItem.call(diagonal2, 800, 1800); // step 2.1 delay = step 2.0 (duration + delay). end step 2.0
    
        animateItem.call(burgerLine1, 1000, 1500); // mobile burger line start with diagonal
        animateItem.call(burgerLine2, 1000, 2000); // mobile burger line

        
        animateItem.call(logoTopCircle, 500, 2200); // step 3.0, delay = step 2.1 (duration(x0.5) + delay)
        animateItem.call(logoBotCircle, 2000, 2200); // step 3.1, delay = step 2.1 (duration(x0.5) + delay), duration = step 3.1.1 (duration) + step 2.1 (duration)
        animateItem.call(logoNK, 1500, 2700); // step 3.1.1, delay = step 3.0 (duration + delay). step 3 end
    
        animateItem.call(logoText, 1000, 3700); // delay = step 3.1.1 (delay) + 1000ms

        finishPreloader(4700);
    }

    startPreloader();
}

function replaceLogoAfterPreload() {
    var logo = $('.logo'),
        logoWidth = logo.outerWidth(),
        scrollLength = logo.position().top,
        headerLogoWidth = $('.menu__link_logo').outerWidth(),
        headerPadTop = parseFloat($('.header__content').css('padding-top'));

    var transformY = $('.logo-text-wrapper').css('transform').match(/([0-9]+)+\)/)[1] - 0;
        
    function onScroll(width, opacity, y) {
        logo.css({
            width: width,
        });

        $('.logo-text-wrapper').css({
            'opacity': opacity*2 - 1,
            'transform': 'translate(-50%, '+(y + transformY)+'px)'
        });

        if ($('.header__content .container').offset().top > logo.offset().top) {
            logo.css('opacity',0);
            $('.menu__link_logo').css('visibility', 'visible');
        } else {
            logo.css('opacity',1);
            $('.menu__link_logo').css('visibility', 'hidden');
        }
    }
        
    $(window).on('scroll', function() {
        var wScrollTop = $(window).scrollTop(),
            logoTop = scrollLength - wScrollTop > headerPadTop ? scrollLength - wScrollTop : headerPadTop,
            logoCoef = 1 - logoTop/scrollLength,
            newWidth = logoWidth*(1 - logoCoef) > headerLogoWidth ? logoWidth*(1 - logoCoef) : headerLogoWidth,
            textOpacity = 1 - logoCoef;

        onScroll(newWidth, textOpacity, wScrollTop);

        if($(window).scrollTop() >= $(window).height() * 0.75) {
            $('.header__content').addClass('hide-to-top');
        } else {
            $('.header__content').removeClass('hide-to-top');
        }
        
    });
}

function pseudoMouse() {
    var pointer = $('.pseudo-mouse');
    $(document).on('mousemove', function(e) {
        pointer.css({
            'top': e.clientY,
            'left': e.clientX
        });
    });

    $('.header__content .menu__link, .mouse-hover').on('mouseover', function() {
        pointer.addClass('large');
    }).on('mouseout', function() {
        pointer.removeClass('large');
    });
}

function jumpToPage() {
    var link = $('.jump-link'),
        circle = $('.jump-to-page');

    link.on('click', function(e) {
        e.preventDefault();
        var href = $(this).attr('href');

        circle.css({
            'left': e.clientX,
            'top': e.clientY
        }).addClass('jump');
        
        setTimeout(openLink, 1100, href);
    });

    function openLink(link) {
        window.location.href = link;
    }
}

function homeProjectSectionTitleMainWaypoint() {
    let sectionTitle = $('#s-home-projects .section-title')

    $('.home-projects__list .home-project__item:first').waypoint(function(direction) {
        if (direction === 'down') {
            sectionTitle.addClass('home-projects__scroll');
        } else if (direction === 'up') {
            sectionTitle.removeClass('home-projects__scroll');
        }
    }, {
        offset: '60%'
    });

    $('.home-projects__list .home-project__item').eq(-2).waypoint(function(direction) {
        if (direction === 'down') {
            sectionTitle.addClass('home-projects__scroll_stage_2');
        } else if (direction === 'up') {
            sectionTitle.removeClass('home-projects__scroll_stage_2');
        }
    }, {
        offset: '60%'
    });

    $('.home-projects__list .home-project__item:last').waypoint(function(direction) {
        if (direction === 'down') {
            sectionTitle.addClass('home-projects__scroll-done');
        } else if (direction === 'up') {
            sectionTitle.removeClass('home-projects__scroll-done');
        }
    }, {
        offset: '60%'
    });
}

function animateWaypoint() {
    var atarget = $('.svg-animate');

    atarget.each(function(idx, el) {
        $(el).waypoint(function(direction) {
            console.log(direction);
            if (direction === 'down') {
                $(el).addClass('animated');
            } else if (direction === 'up') {
                $(el).removeClass('animated');
            }
        }, {
            offset: '60%',
            // triggerOnce: true
        });
    })
}

function animateCSS() {
    var atarget = $('.js-animation');

    atarget.each(function(idx, el) {
        var name = $(el).data('animation');
        $(el).waypoint(function() {
            $(el).addClass('animated '+name);
        }, {
            offset: '80%',
            triggerOnce: true
        });
    })
}

function checkMouse() {
    if (matchMedia('(pointer:fine)').matches) {
        $('html').addClass('has-mouse');
    } else {
        $('html').removeClass('has-mouse');
    }
}

function menuMobToggle() {
    var burgerLink = $('.menu__link_burger, .close-navabar'),
        menu = $('.navbar-mob');

    burgerLink.on('click', function(e) {
        e.preventDefault();

        if (scrollLocked) {
            unlockScroll();
        } else {
            lockScroll();
        }
        
        menu.fadeToggle();
    });
}

function textareaRowsToggle() {
    var ta = $('.textarea'),
        taH = ta.outerHeight();

    ta.on('focus', function() {
        if ($(this).val() === '') {
            taH = $(this).outerHeight();
        }
    });

    ta.on('input', function () {
        ta.attr('rows', 1);
        var taSH = this.scrollHeight,
            rows = Math.ceil(taSH / taH);

        if (rows >= 3) {
            rows = 3
        }

        ta.attr('rows', rows);
    });
}

function conceptToggle() {
    var section = $('.concept-section'),
        items = $('.js-concept .concept__item');

    section.each(function(idx, el) {
        var elOffsetTop = $(el).offset().top,
            elHeight = $(el).outerHeight(),
            elBottom = elOffsetTop + elHeight;

        $(window).on('resize', function() {
            elOffsetTop = $(el).offset().top,
            elHeight = $(el).outerHeight(),
            elBottom = elOffsetTop + elHeight;
        });
            
        $(window).on('scroll', function() {
            if ($(window).scrollTop() >= elOffsetTop && $(window).scrollTop() < elBottom) {                
                items.not(items.eq(idx)).stop().hide();
                items.eq(idx).stop().show();
            }
        });
    })
}

function projectSVGImage() {
    var svgTargets = $('.project-svg-wrapper svg *').not('defs, title, g');

    svgTargets.each(function(idx, el) {
        console.log(el.pathLength);
    });
}

function productsFooter() {
    var link = $('.product-footer__link'),
        imgWrapper = $('.product-footer__img');

    link.on('mouseover', function(e) {
        var imgLink = $(this).data('img');
        console.log(imgLink);

        imgWrapper.css({
            'background-image': 'url('+imgLink+')',
            'opacity': 1
        });
    });

    link.on('mouseleave', function(e) {
        imgWrapper.css({
            'background-image': '',
            'opacity': 0
        });
    });
}

$(document).ready(function() {
    if ($('body').hasClass('with-preloader')) {
        preloader();
        replaceLogoAfterPreload();
    }

    $('.input_tel').inputmask({
		"mask":"+7 (799) 999-99-99",
		"clearMaskOnLostFocus": true,
		"showMaskOnHover": false,
		"clearIncomplete": true,
	});
    
    checkMouse();
    $(window).resize(function() {
        checkMouse();
    })
    
    pseudoMouse();
    jumpToPage();
    homeProjectSectionTitleMainWaypoint()
    animateWaypoint();
    // animateCSS();
    menuMobToggle();
    textareaRowsToggle();
    conceptToggle();
    projectSVGImage();

    if ($('#product-svg').length > 0) {
        new Vivus('product-svg', {
                type: 'sync',
                duration: 250,
                animTimingFunction: Vivus.EASE,
                onReady: function(myVivus) {
                    myVivus.el.style.opacity = 1;
                }
            },
            function(myVivus) {
            // myVivus.el.classList.add("animated");
            $(myVivus.el).siblings('.product-img').addClass("animated");
            }
        );
    }

    productsFooter();

    $("form.form_feedback").on("submit", function (event) {
        event.preventDefault();
        $.post( $(this).attr("action"), $(this).serialize(), function () {
            $('[data-remodal-id=success]').remodal().open();
        } );
    });
});

$(window).load(function() {
    conceptToggle();
});

window.onpageshow = function(event) {
    if (event.persisted) {
        $('.jump-to-page').removeClass('jump');
    }
};
